//import { useParams } from 'react-router-dom';

function locationPage() {
    const [location, setLocation] = useState({tags:[], equipements:[], pictures:[], rating:'', host:{'name':'', 'picture':''}});

    //let id = useParams();

    useEffect(function () {
        fetch('/data.json')
        .then((response) => {
            return console.log(response);
        })
    })
    return (
        <div>
            <h1>logement</h1>
        </div>
    );
}

export default locationPage;
